	(68,24,NULL,'2015-12-23 01:00:19',NULL,36,36,NULL,2,NULL,'subject','has subject','A concept that is a subject of the resource.','The following rule may be applied for this property: [(?d skos:subject ?x)(?x skos:broader ?y) implies (?d skos:subject ?y)]','property','skos:subject',1,'en',NULL,NULL,700,700,'http://www.w3.org/2004/02/skos/core/examples/subject.rdf.xml',0,0,0,1,1,64,0,0,1,0,0,0,1,0,'http://www.w3.org/2004/02/skos/core#'),
	(69,25,NULL,'2015-12-23 01:00:19',NULL,36,36,NULL,2,NULL,'subjectIndicator','subject indicator','A subject indicator for a concept. [The notion of \'subject indicator\' is defined here with reference to the latest definition endorsed by the OASIS Published Subjects Technical Committee.]','This property allows subject indicators to be used for concept identification in place of or in addition to directly assigned URIs.','property','skos:subjectIndicator',1,'en',NULL,NULL,740,740,'http://www.w3.org/2004/02/skos/core/examples/subjectIndicator.rdf.xml',0,0,0,1,1,NULL,0,0,1,0,0,0,1,0,'http://www.w3.org/2004/02/skos/core#'),
	(70,26,NULL,'2015-12-23 01:00:19',NULL,36,36,NULL,2,NULL,'symbol','symbolic label','An image that is a symbolic label for the resource.','This property is roughly analagous to rdfs:label, but for labelling resources with images that have retrievable representations, rather than RDF literals.','property','skos:symbol',1,'en',NULL,NULL,800,800,'http://www.w3.org/2004/02/skos/core/examples/symbol.rdf.xml',0,0,0,1,1,NULL,0,0,1,0,0,0,1,0,'http://www.w3.org/2004/02/skos/core#'),
